var tke={init:function(a){console.group("tke.init");tk.tracker("tke");jQuery("e").addClass("editable");console.groupEnd("tke.init")},save:function(a){console.log("tke.save: "+a);tk.load(".tk-dummy","/mtk/render?callback=tke::save&id="+a+"&value="+escape($("#"+a).html()))},wcheck:function(){console.log("tke.edits");console.log("editables: "+jQuery("e").length);jQuery("e").each(function(){obj=$(this);id=obj.attr("id");val=obj.html();tk.load(".tk-dummy","/mtk/render?callback=tke::restore&id="+id+"&val="+escape(val))})},check:function(){console.group("tke.edits");console.log("editables: "+jQuery("e").length);var a="";jQuery("e").each(function(){a+=$(this).attr("id")+","});console.log("IDS: "+a);tk.load(".tk-dummy","/mtk/render?callback=tke::restore&ids="+a);console.groupEnd()},tkedit:function(){console.log("tke.tkedit");edit=jQuery.cookie("tkedit");if(edit=="null"){jQuery.cookie("tkedit","1")}else{jQuery.cookie("tkedit",null)}document.location.reload()},showEdits:function(){console.log("tke.showEdits");if(jQuery("e").hasClass("tkedit-bg")){jQuery("e").removeClass("tkedit-bg")}else{jQuery("e").addClass("tkedit-bg")}}};